import React from 'react'
import "./home.scss";
const Home = () => {
  return (
    <section className="about section" id="about">
        <h2 className="section__title" style="color:hsl(var(--hue-color),8%,95%);">About Me</h2>
        <span className="section__subtitle"style="color:hsl(var(--hue-color),8%,80%);">My introduction</span>

    </section>
  )
}

export default Home
